import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import Comp01 from './comp/Comp01';
import Comp02 from './comp/Comp02';
import Comp03 from './comp/Comp03';
import Comp04 from './comp/Comp04';
import Comp05 from './comp/Comp05';
import Comp06 from './comp/Comp06';
import Comp07 from './comp/Comp07';
import Comp08 from './comp/Comp08';
import Comp09 from './comp/Comp09';
import Comp10 from './comp/Comp10';
import Comp11 from './comp/Comp11';
import Comp12 from './comp/Comp12';
import Comp13 from './comp/Comp13';
import Comp14 from './comp/Comp14';
import Comp15 from './comp/Comp15';
import Comp16 from './comp/Comp16';
import Comp17 from './comp/Comp17';
import Comp18 from './comp/Comp18';
import Comp19 from './comp/Comp19';
import Comp20 from './comp/Comp20';
import Comp21 from './comp/Comp21';
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Comp21 />
    <Comp20 />
    <Comp19 />
    <Comp18 />
    <Comp17 />
    <Comp16 />
    <Comp15 />
    <Comp14 />
    <Comp13 />
    <Comp12 />
    <Comp11 />
    <Comp10 />
    <Comp09 />
    <Comp08 />
    <Comp07 />
    <Comp06 />
    <Comp05 />
    <Comp04 />
    <Comp03 />
    <Comp02 />
    <Comp01 />
    <App />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
